CREATE TABLE `tbl_member` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL,
  `password` varchar(128) NOT NULL COMMENT '彩虹码',
  `active_code` varchar(8) NOT NULL,
